import React from 'react';
import './Viewpoints.css';

function Viewpoints() {
    return (
        <div className="flex_container">
            <div className="Attribute">
                <a href="/AboutMe">
                    <button className="AttributePhoto">About Me</button>
                </a>
            </div>
            <div className="Attribute">
                <a href="/Experiences">
                    <button className="Attribute">Experience</button>
                </a>
            </div>
            
            
            <a href="/Projects">
                <button className="Attribute">Projects</button>
            </a>
            <a href="/Skills">
                <button className="Attribute">Skills</button>
            </a>
        </div>
    );
}

export default Viewpoints;
